__NUXT_JSONP__("/gallery/the-rock", (function(a,b){return {data:[{document:{date:a,title:[{type:"heading3",text:"The Rock",spans:[]}],photo:{dimensions:{width:800,height:1200},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Ff320434c-132d-4b04-a406-12847e612017_The+Rock.jpg?auto=compress,format",small:{dimensions:{width:320,height:480},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Ff320434c-132d-4b04-a406-12847e612017_The+Rock.jpg?auto=compress,format&rect=0,0,800,1200&w=320&h=480"}},content:[{type:b,text:"We drove to Gibraltar with some friends. Having never been there  before and had only seen pictures and tales of apes, I didn’t quite  know what to expect. But I never could have dreamed I’d see this  lenticular cloud just hanging out atop the rock as the morning mist  rose. Don’t know whether or not it’s a common occurrence, but it was a  sight I’ll never forget. This is one awesome place and I’m glad I had  the camera. ",spans:[]},{type:b,text:"Shot with a Canon EOS 100 + EF 28-80 USM on Fuji Reala 100 ISO print film.",spans:[]}],tag:"landscape"}}],fetch:[],mutations:void 0}}(null,"paragraph")));